const Discord = require("discord.js");
const fs = require('fs');

var rectarray = globalVars('reactionRoleInf');

var reactionArray = [];
var emojiArray = [];
var roleArray = [];
var embedSettings = [];

const _this = this;

var errorCatch = 5;
var emojiTimerRe = 0;

var localEmoji;
var localEmojiG;
var interval;
var mainMessage;


let embedTemplate = new Discord.RichEmbed({
    color: 0x00FF00,
    author: {
        name: client.user.username,
        icon_url: client.user.avatarURL
    },
    title: "AutoRoleMenu",
    description: `Witamy w AutoRoleMenu.\n\nWpisz sw√≥j tytu≈Ç do embed messages!`,
    timestamp: new Date(),
})

// Settings
let grabAllEmoji = false; // Default: false || Set true if you want the bot to use global emojis from all the servers its in. (May cause slowdowns in larger servers)
let roleLimit = 10; // Default: 10 || Sets the maximum number of roles attached to emojis.
let debug = false; // Default: false || Prints any errors that may have occured; will also print for await messages that ran out of time
//

if (grabAllEmoji) {
    localEmoji = (client || this.getDBM().Bot.bot).emojis.array();
    localEmojiG = "Sprawdz czy bot jest aktywny na serwerze";
} else {
    localEmoji = msg.guild.emojis.array();
    localEmojiG = "Sprawdz czy emoji jest na twoim serwerze!";
}

if (msg.member.hasPermission('MANAGE_ROLES')) {
    msg.channel.send(embedTemplate)
        .then(async (message) => {
            mainMessage = message;
            askQuestion(`Witamy w AutoRoleMenu.\n\nWpisz sw√≥j tytu≈Ç do embed message`).then((response) => {
                embedSettings[0] = response.content;
                askQuestion(`Tw√≥j tytu≈Ç to **${response.content}**\n\nKiedy wpisa≈Çe≈õ tytu≈Ç, Napisz sw√≥j opis.\nKiedy co≈õ ci siƒô pomyli≈Ço wpisz "**anuluj**"`).then((response) => {
                    embedSettings[1] = response.content;
                    if (response.content.toLowerCase() != "anuluj") {
                        askQuestion(`Tw√≥j embed message to **${embedSettings[0]}** I tw√≥j opis to:\n\n${embedSettings[1]}\n\nGdy wszystko ci sie podoba wpisz "**potwierdz**".\nGdy co≈õ ci sie nie podoba napisz "**anuluj**".`).then((response) => {
                            if (response.content.toLowerCase() == "potwierdz") {
                                reAsk(message, " ");
                            } else {
                                errorMessage('Menu od≈ºucone (nie odpowiedzia≈Ç potwierdz ).\nWykonaj ponownie polecenie, aby ponownie przej≈õƒá do menu!', "U≈ºytkownik nie odpowiedzia≈Ç potwierdzeniem na opis + wiadomo≈õƒá o potwierdzeniu tytu≈Çu");
                            }
                        })
                    } else {
                        errorMessage("Menu zosta≈Ç anulowany na ≈ºƒÖdanie u≈ºytkownika.\"");
                    }
                })
            })
        })
} else {
    errorMessage("Nie masz permisji `zmiania≈Ñe r√≥l` permisjia, kt√≥r jest wymagana do wykonania tego polecenia!", "U≈ºytkownik nie ma uprawnie≈Ñ do wykonania polecenia.");
}

function reAsk(message, extra) {
    if (extra == null) {
        extra = "";
    }
    if (reactionArray.length != roleLimit) {
        var finalText = "";
        reactionArray.forEach(subarray => {
            finalText = finalText + `${subarray[0]} => ${subarray[2]}\n`
        })
        askQuestion(`Wprowad≈∫ teraz po≈ÇƒÖczenia reakcyjne ** emoji-role ** (Max ${roleLimit})\n ${finalText}\n\nJe≈õli chcesz do≈ÇƒÖczyƒá kolejnƒÖ reakcjƒô do roli, wstaw rolƒô wraz z emoji. \NEx. ExampleRole üòÉ \nJe≈õli nie, proszƒô odpowiedzieƒá ‚Äû** done **‚Äù. \NJe≈õli you would like to cancel the prompt, please respond with "cancel"\n\n${extra}`).then(async (response) => {
            if (response.content.toLowerCase() == "ok") {
                if (reactionArray.length > 0) {
                    done(message);
                } else {
                    errorCheck(message, `**Przynajmniej 1 do≈ÇƒÖcz emoji do 1 roli! \NPozosta≈Ço - ${errorCatch}**`, "Menu zosta≈Ç anulowany, dwukrotnie u≈ºywa≈Çe≈õ tego samego emoji do r√≥≈ºnych r√≥l! \NPonownie uruchom komendƒô, aby ponownie przej≈õƒá do menu!");
                }
            } else if (response.content.toLowerCase() == "anuluj") {
                errorMessage("Menu zosta≈Ço anulowane. \NPonownie uruchom komendƒô, aby ponownie przej≈õƒá do menu! "," U≈ºytkownik odpowiedzia≈Ç anulowaniem, anulujƒÖc w ten spos√≥b menu", message);
            } else {
                var regString = response.content;
                var execReg = /[^\x00-\x7F]/g.exec(regString) || /\<:(.*?)\>/g.exec(regString) || /\<a:(.*?)\>/g.exec(regString);
                var msgSplitArr = null;

                if (execReg != null) {
                    msgSplitArr = [regString.substring(0, execReg["index"]), regString.substring(execReg["index"])];
                }

                if (msgSplitArr != null && msgSplitArr.length > 1 && msgSplitArr[0] != null && msgSplitArr[1] != null) {
                    const tstValidRole = await msg.guild.roles.find(role => role.name === msgSplitArr[0].replace(/\s+$/, ''));

                    if (response.mentions.roles.first() || tstValidRole != null) {
                        var unicodeStored = msgSplitArr[1];
                        if (response.mentions.roles.first() != null) {
                            roleMentioned = response.mentions.roles.first();
                        } else {
                            roleMentioned = tstValidRole;
                        }
                        if (!roleArray.includes(roleMentioned.id) && !emojiArray.includes(unicodeStored)) {
                            if (unicodeStored.includes("<:") || unicodeStored.includes("<a:")) {
                                var emoji;

                                unicodeStored = unicodeStored.replace(/\D/g, '');
                                emoji = localEmoji.filter(emojiT => emojiT.id == unicodeStored);
                                if (emoji.length > 0) {
                                    unicodeStored = emoji[0];
                                    delete unicodeStored['guild']
                                    reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                    emojiArray.push(unicodeStored);
                                    roleArray.push(roleMentioned.id);
                                    reAsk(message);
                                } else {
                                    errorCheck(message, `**Podaj poprawne niestandardowe emoji!\n${localEmojiG}\n - ${errorCatch}**`, `Menu zosta≈Ç anulowany, poda≈Çe≈õ nieprawid≈Çowe niestandardowe emoji!\n${localEmojiG}\nPlease re-execute the command to go through the prompt again!`)
                                }
                            } else {
                                reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                emojiArray.push(unicodeStored);
                                roleArray.push(roleMentioned.id);
                                reAsk(message);
                            }
                        } else {
                            errorCheck(message, `**Nie u≈ºywaj dwukrotnie tej samej emoji / roli!\nPrubuje Pozostaƒá - ${errorCatch}**`, "Menu zosta≈Ç anulowany, dwukrotnie u≈ºy≈Çe≈õ tej samej roli w wierszu! \NPonownie uruchom polecenie, aby ponownie przej≈õƒá przez wiersz!");
                        }
                    } else {
                        errorCheck(message, `**Podaj prawid≈ÇowƒÖ rolƒô! \NPozosta≈Ço - ${errorCatch}**`, "Menu zosta≈Ç anulowany, nie wspomnia≈Çe≈õ o prawid≈Çowej roli! \NPonownie uruchom komendƒô, aby ponownie przej≈õƒá do menu!");
                    }
                } else {
                    errorCheck(message, `**Podaj poprawnƒÖ emoji / rolƒô! \NPozosta≈Ço - ${errorCatch}**`, "Menu zosta≈Ç anulowany, nie poda≈Çe≈õ roli emoji / wspomnianej roli! \NPonownie uruchom komendƒô, aby ponownie przej≈õƒá do Menu!");
                }
            }
        });
    } else {
        done(message);
    }
}


function done(message) {
    var finalText = "";
    reactionArray.forEach(subarray => {
        finalText = finalText + `${subarray[0]} => ${subarray[2]}\n`
    })

    askQuestion(`Ostateczne menu konformacji \n \n Poni≈ºej znajduje siƒô lista reakcji na ich role \n${finalText}\n\nJe≈õli jest to poprawne, proszƒô odpowiedzieƒá ** wzmiankƒÖ ** na ** kana≈Ç tekstowy **, do kt√≥rego zostanie wys≈Çane menu r√≥l. \NJe≈õli to nie jest poprawne, odpowiedz ‚Äû** anuluj **‚Äù, aby anulowaƒá sk≈Çoniƒá.`).then ((response) => {
        if (response.mentions.channels.first()) {
            var menchannel = response.mentions.channels.first()
            message.delete();
            menchannel.send({
                    embed: {
                        color: 0xffff00,
                        title: embedSettings[0],
                        description: `${embedSettings[1]}\n\n${finalText}`,
                        timestamp: new Date()
                    }
                })
                .then(embedmessage => {
                    interval = setInterval(function() {
                        emojiTimerInt(embedmessage, reactionArray);
                    }, 500)
                    rectarray[embedmessage.id] = reactionArray
                    _this.storeValue(rectarray, 3, "reactionRoleInf", cache);
                    fs.writeFile("./data/reactionRoleData.json", JSON.stringify(rectarray), function(err) {
                        if (err) {
                            return console.log(err);
                        }
                    });
                });
        } else {
            errorMessage("Nie wspomnia≈Çe≈õ o prawid≈Çowym kanale! \NPonownie uruchom polecenie, aby ponownie przej≈õƒá przez menu! ‚Äù,‚Äû U≈ºytkownik nie odpowiedzia≈Ç prawid≈Çowym kana≈Çem, a tym samym anulowa≈Ç menu.", message);
        }
    });
}

function emojiTimerInt(message, subarray) {
    message.react(subarray[emojiTimerRe][0])
    emojiTimerRe += 1;

    if (emojiTimerRe == subarray.length) {
        clearInterval(interval);
    }
}

function errorMessage(error, errorCause = "none") {

    if (debug) {
        console.log(errorCause);
    }

    if (mainMessage != null) {
        mainMessage.delete();
    }

    let errorTemplate = new Discord.RichEmbed({
        color: 0xFF0000,
        author: {
            name: client.user.username,
            icon_url: client.user.avatarURL
        },
        title: "AutoRoleMenu",
        description: error,
        timestamp: new Date(),
    })

    msg.channel.send(errorTemplate);
}

function errorCheck(mainMessage, erMsgCatch, erMsgFail) {
    if (errorCatch > 0) {
        errorCatch -= 1;
        reAsk(mainMessage, erMsgCatch)
    } else {
        errorMessage(erMsgFail, "U≈ºytkownikowi zabrak≈Ço pr√≥b, a zatem menu zostanie anulowany.", mainMessage);
    }
}


function askQuestion(question) {
    return new Promise(function(resolve, reject) {
        embedTemplate["description"] = question;
        mainMessage.edit(embedTemplate);
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 60000,
                errors: ['time'],
            })
            .then(function(collected) {
                msg.author.lastMessage.delete();
                resolve(collected.first());
            }).catch((error) => {
                errorMessage('Niestety, nie dostarczy≈Çe≈õ prawid≈Çowej odpowiedzi na czas! \NPonownie uruchom polecenie, aby ponownie przej≈õƒá przez menu!', error);
            });
    })

}
